    constructor(props) {
      super(props);
  }

  render(){
      const token = localStorage.getItem('token');
      if(!token){
          return  <Home />
      }

    return (
      <div className="App">
        <Home />
        <Category />

      </div>
    )
  }
}

export default Main;
